import { Link } from "react-router-dom";
import SearchBar from "../SearchBar/SearchBar";
import style from "./Nav.module.css"

export default function Nav ({onSearch, logout}) {
    return (
        <nav className={style.container}>
            <Link to={'/home'}><button className={style.container}>Home</button></Link>
            <Link to={'/favorites'}><button className={style.container}>Favorites</button></Link>
            <Link to={'/about'}><button className={style.container}>About</button></Link>
            <SearchBar onSearch={onSearch} />
            <Link to={'/'}><button className={style.container}>Log out</button></Link>
        </nav>
    )
}
